`,u.jsx(t.p,{children:"The Statistical Querry Service is an opportunity for researchers at schools, public organizations, and other policy hubs to easily and safely add aggregated employment and earnings data from the federal government to the data they already have. If you are at such an organization, you can securely send Georgetown, the intermediary for the project, your data, which will then be formatted and sent on to the Internal Revenue Service, who will match it to their earnings data and send summary information back through Georgetown to you. Georgetown helps make this process possible for researchers as well as providing resources to make it easier for you to understand the results you receive."}),`
`,u.jsx(t.h3,{children:"Who are targeted users of the SQS?"}),`
`,u.jsx(t.p,{children:"Anyone at a not-for-profit or government entity who is evaluating an educational, social services, or similar program. The SQS is NOT for for-profit businesses or universities, marketing purposes, surveillance, law enforcement, or individual use."}),`
`,u.jsx(t.h3,{children:"How can the SQS help me?"}),`
`,u.jsx(t.p,{children:"The SQS can fill in critical gaps in your knowledge about your data subjects by providing federal earnings and employment data to augment your existing data. This data has the potential to help with program planning and evaluation of policies by tracking results of educational initiatives and like projects down the road. Because the data is federal, it will include individuals who may be missed in any state specific data you have access to, such as individuals who have moved across state lines."}),`
`,u.jsx(t.h3,{children:"What phases of the SQS are planned?"}),`
`,u.jsx(t.p,{children:"The SQS will initially serve as a link between the IRS and a select group of pilot organizations who request data matches under Georgetown and Yales coordination. Georgetowns Massive Data Institute will serve as the temporary intermediary during this phase. In the future, the system will be opened to include other federal data from different organizations, be accessible to a wider range of users, and may be run by an independent intermediary for long-term service, such as the National Secure Data Service."}),`
`,u.jsx(t.h3,{children:"Who are your partners?"}),`
`,u.jsx(t.p,{children:"The SQS is a collaboration between Georgetown Universitys Massive Data Institute, Yale Universitys Tobin Center for Economic Policy, the Internal Revenue Service, and you!"})]})}function vS(e={}){const{wrapper:t}=e.components||{};return t?u.jsx(t,{...e,children:u.jsx(pd,{...e})}):pd(e)}function hd(e){const t={h3:"h3",p:"p",...e.components};return u.jsxs(u.Fragment,{children:[u.jsx(t.h3,{children:"Who is represented in the matching data?"}),`
`,u.jsx(t.p,{children:"Currently, the SQS is focused on providing data from Internal Revenue Service Administrative Tax Records. This includes information returns from all workers receiving W-2s and independent contractors receiving 1099s, as well as 1040s from self employed or business income. However, earnings from self-employment by individuals who did not file a tax return will not be included. Data is only updated annually and will not include quarter by quarter wage reports."}),`
`,u.jsx(t.h3,{children:"How current are the IRS data youre matching to?"}),`
`,u.jsx(t.p,{children:"IRS data is updated from annual tax records on a yearly basis, and we expect data from the previous calendar year to be available for matching each August."}),`
`,u.jsx(t.h3,{children:"Do the aggregate data that I get back include demographic information?"}),`
`,u.jsx(t.p,{children:"No, the data does not include demographic information; it will be aggregate statistics such as xyz, but you may choose which demographic information in your submitted data you want to sort by/to match income by demographic characteristics."}),`
`,u.jsx(t.h3,{children:"What other data are available aside from earnings statistics?"}),`
`,u.jsx(t.p,{children:"Currently only earnings data from the IRS are available, though we hope to expand to other sources of federal government data in the future, such as NDNH and Census data."}),`
`,u.jsx(t.h3,{children:"Can I share the data with others on my team or the public?"}),`
`,u.jsx(t.p,{children:"Yes, the data you receive back from the SQS will be suitable for sharing both internally and to the public with no greater restrictions than those you have placed on your original input data."}),`
`,u.jsx(t.h3,{children:"What technical skills do I need to have to use the interface?"}),`
`,u.jsx(t.p,{children:"Basic data processing and analysis skills are needed to ensure your data is in the correct format to submit to the SQS, though our Wizard  will help walk you through this process to ensure it is as easy as possible. If youre already working with your data, you have the skills. When you receive your results, additional statistical skills may be needed to get the most out of interpreting them."})]})}function gS(e={}){const{wrapper:t}=e.components||{};return t?u.jsx(t,{...e,children:u.jsx(hd,{...e})}):hd(e)}function md(e){const t={a:"a",h3:"h3",p:"p",...e.components};return u.jsxs(u.Fragment,{children:[u.jsx(t.h3,{children:"What kind of computing capacity do I need to have?"}),`
`,u.jsx(t.p,{children:"No additional computing capacity is required beyond your pre-existing data system and the means to securely transfer files, either by upload to a secure site or FTP."}),`
`,u.jsx(t.h3,{children:"Where are the data stored?"}),`
`,u.jsx(t.p,{children:"The data will be stored in Georgetown Universitys secure data storage, before being transferred to the Internal Revenue Service secure storage for matching. Georgetown will maintain a copy of the data until the matches are received from the IRS, at which point they will be paired with the original data, returned to the user, and the original data deleted."}),`
`,u.jsx(t.h3,{children:"Can I see an example of the output statistics?"}),`
`,u.jsx(t.p,{children:"Yes, you can see an example of what each step of the process, including output, will look like here."}),`
`,u.jsx(t.h3,{children:"How can I find out about other studies using these data?"}),`
`,u.jsx(t.p,{children:"Look out for publications highlighting research done with the SQS! We will also help connect organizations looking to answer similar questions with the data to help enable community collaboration."}),`
`,u.jsx(t.h3,{children:"Do businesses/for-profit entities have access to this data?"}),`
`,u.jsx(t.p,{children:"No, only non-profit and research organizations may use the SQS matching service."}),`
`,u.jsx(t.h3,{children:"How do I attribute the sources?"}),`
